    let value = log10((dataArray[index] + 0.01) / (uniforms.minLuminance + 0.01));
    let scaledValue = (value / log10((uniforms.maxLuminance + 0.01) / (uniforms.minLuminance + 0.01)) * 255.0);
    let lutIndex = i32(scaledValue);

